import React from 'react';
import staticServices from '../../constants/staticServices';

class ServicesSection extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            services: staticServices(),
        }
    }

    render(){
        const service = this.state.services.map((service, index) => {
            return(
                <div data-id={index} className='service' style={{borderLeft: `solid 1px ${service.color}`}}>
                    <img className="header-logo" src={service.iconServices} alt="logo" />
                    <ul>
                        {service.list.map((element, index)=>{
                            return(
                                <li data-id={index}>{element.contentList}</li>
                            )
                        })}
                    </ul>
                </div>
            )
        });

        return (
            <div className={'services-section container-dft'}>
                {service}
            </div>
        )
    }
}

export default ServicesSection;
